import './Header.css';
import Curriculo from "../../Arquivos/Felipe_camoes.pdf"
import { Link } from 'react-router-dom';

export default function Header() {
    let clicado = true;

    function dropdown(el) {
      if (clicado) {
        el.target.childNodes.forEach((ell) => {
          const link = ell.children[0];
    
          if (link && link.classList.contains('header__link')) {
            link.classList.add('header__linkDropdown');
            console.log("ds");
          } else if (link) {
            link.classList.remove('header__linkDropdown');
          }
        });
    
        clicado = false;
      } else {
        clicado = true;
      }
    }
    return (
        <header className="header">
            <h1>< Link to="/" className="header__name" >Felipe Camões</Link></h1>
            <nav>
                <ul className='header__dropdown' onClick={dropdown} >
                    <li><Link to='/pdv' className="header__link">Home</Link></li>
                    <li><Link to={Curriculo} className="header__link" download={Curriculo}>Curriculo</Link></li>
                    <li><Link to="https://github.com/felipe-camoes" className="header__link" target="_blank" rel="noreferrer">Git-hub</Link></li>
                    <li><Link to="https://linkedin.com/in/felipe-camões-9b68701b0" className="header__link" target="_blank" rel="noreferrer" >Linkedin</Link></li>
                </ul>
            </nav>
        </header>
    );
}
